import React, { PureComponent } from "react";
// import "./Header.css";

class Header extends PureComponent {
  render() {
    return (
      <header className="component-header">
        <a href="#" class="fas fa-bars fa-2x"></a>
      </header>
    );
  }
}
export default Header;
